    render() {
        return (
          <React.Fragment>
            <section className= "card-container">
                <header>
                  <span initials="MS"></span> 
                  <h2>Master Splinter</h2> 
                </header>
            </section>
            <h1>Hello World</h1>
            <h2>Hello Again!</h2>
          </React.Fragment>
        )
    }
}

export default Card;
